import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import addButton from '../static/images/plus.svg';

class AddTaskForm extends React.Component {
  render() {
    return (
<Container fluid = {true} style = {{border: "1px solid red", paddingLeft: "20%", paddingRight: " 20%"}}>
    <Row>
        <Col>
  <Container style = {{padding: 0, marginTop: "100px", marginBottom: "100px", border: "1px solid black", borderRadius: "10px"}}>
    <Row style = {{padding: 0, marginLeft: "3%", marginRight: "5%"}} className = "justify-content-md-center">
      <Col xs = {8} style = {{display: "flex", justifyContent: "center", textAlign: "center", paddingTop: "15px", paddingBottom: "15px"}}>
        <Form.Control placeholder="Add Task" />
      </Col>
      <Col xs = {3} style = {{display: "flex", justifyContent: "center", textAlign: "center", paddingTop: "15px", paddingBottom: "15px"}}>
        <img src = {addButton} width = "35px" height = "35px" alt = "Add Button"/>
      </Col>
    </Row>
  </Container>
  </Col>
  </Row>
  </Container>
);}}

export default AddTaskForm;
